import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class AboutPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            width: 500,
            height: 200,
            backgroundColor: "rgb(255, 203, 105)",
            margin: 50,
            fontFamily: "Unna",
            fontSize: 65,
            fontWeight: "bold",
            display: "grid",
            justifyContent: "center",
            alignContent: "center",
            gridTemplateRows: "70px 70px",
          }}
        >
          <div>Vivan</div>
          <div>Marwaha</div>
        </div>
      </div>
    );
  }
}

export default AboutPage;
